sys_variable_value.value:
(function execute(inputs, outputs) {
inputs = new FirstAdvantageSpokeUtils().trimStringInputs(inputs);
	if (inputs.status_code == '200') {
		outputs.status = 'Success';
	} else
		outputs = new FirstAdvantageSpokeErrorHandler()
		.updateCandidateDetailsErrorHandler(inputs, outputs);
})(inputs, outputs);

